// ==UserScript==
// @name               canned-laughter
// @namespace          npm/vite-plugin-monkey
// @version            0.2.0
// @author             pacexy
// @description        Add canned laughter to web. 为网页添加罐头笑声。
// @description:en-US  Add canned laughter to web
// @description:zh-CN  为网页添加罐头笑声
// @license            MIT
// @icon               https://raw.githubusercontent.com/pacexy/canned-laughter/main/public/images/1f604.png
// @homepage           https://github.com/pacexy/canned-laughter#readme
// @homepageURL        https://github.com/pacexy/canned-laughter#readme
// @source             https://github.com/pacexy/canned-laughter
// @supportURL         https://github.com/pacexy/canned-laughter/issues
// @match              *://www.bilibili.com/bangumi/play/ep*
// @downloadURL https://update.greasyfork.org/scripts/457110/canned-laughter.user.js
// @updateURL https://update.greasyfork.org/scripts/457110/canned-laughter.meta.js
// ==/UserScript==

(function() {
  "use strict";
  const cannedLaugh = "data:audio/mpeg;base64,";
  const crowdLaughing = "data:audio/mpeg;base64,";
  const shortLaughingSoundEffect = "data:audio/mpeg;base64,";
  const a524775_1 = "data:audio/mpeg;base64,";
  const a524775_2 = "data:audio/mpeg;base64,";
  const a524775_3 = "data:audio/mpeg;base64,";
  const a524775_4 = "data:audio/mpeg;base64,";
  const a524775_5 = "data:audio/mpeg;base64,";
  const a524775_6 = "data:audio/mpeg;base64,";
  const audios = [
    cannedLaugh,
    crowdLaughing,
    shortLaughingSoundEffect,
    a524775_1,
    a524775_2,
    a524775_3,
    a524775_4,
    a524775_5,
    a524775_6
  ];
  function play() {
    const audio = document.createElement("audio");
    audio.classList.add("canned-laughter");
    audio.volume = 0.5;
    document.body.append(audio);
    audio.addEventListener("pause", () => {
      audio.remove();
    });
    const i = Math.floor(Math.random() * audios.length);
    audio.src = audios[i];
    audio.play();
  }
  window.addEventListener("keydown", (e) => {
    if (e.key === "h") {
      play();
    }
  });
  console.log("[canned-laughter] loaded");
})();
